import './App.css';

function App() {
  return (
    <div className="min-h-screen bg-stone-100">
      {/* Header - Dark Blue Bar */}
      <header className="bg-blue-900 h-16 flex items-center justify-end px-6">
        <div className="w-8 h-8 border-2 border-white rounded-full flex items-center justify-center">
          <svg className="w-5 h-5 text-white" fill="none" stroke="currentColor" viewBox="0 0 24 24">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M16 7a4 4 0 11-8 0 4 4 0 018 0zM12 14a7 7 0 00-7 7h14a7 7 0 00-7-7z" />
          </svg>
        </div>
      </header>

      {/* Main Content Area */}
      <div className="border-2 border-stone-300 m-2 md:m-4 h-[calc(100vh-4rem)] md:h-[calc(100vh-6rem)]">
        <div className="flex h-full">
          {/* Left Section - Red Rectangle */}
          <div className="w-1/2 md:w-1/3 bg-red-600 border-r-2 border-stone-300">
            {/* Empty red section */}
          </div>

          {/* Right Section */}
          <div className="w-1/2 md:w-2/3 flex flex-col">
            {/* Top Right - Yellow Rectangle */}
            <div className="h-1/2 bg-yellow-400 border-b-2 border-stone-300">
              {/* Empty yellow section */}
            </div>

            {/* Bottom Right - Five Dark Blue Blocks */}
            <div className="h-1/2 flex justify-center items-center px-2 md:px-8">
              <div className="w-12 h-12 md:w-16 md:h-16 bg-blue-900 border-r-2 border-stone-300">
                {/* Block 1 */}
              </div>
              <div className="w-12 h-12 md:w-16 md:h-16 bg-blue-900 border-r-2 border-stone-300">
                {/* Block 2 */}
              </div>
              <div className="w-12 h-12 md:w-16 md:h-16 bg-blue-900 border-r-2 border-stone-300">
                {/* Block 3 */}
              </div>
              <div className="w-12 h-12 md:w-16 md:h-16 bg-blue-900 border-r-2 border-stone-300">
                {/* Block 4 */}
              </div>
              <div className="w-12 h-12 md:w-16 md:h-16 bg-blue-900">
                {/* Block 5 */}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
